import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

export default function LocationPage() {
    const [ setLocation] = useState({tags:[], equipements:[], pictures:[], rating:'', host:{'name':'', 'picture':''}});

    let id = useParams();

    useEffect(function () {
        fetch('/data.json')
        .then((response) => {
            return response.json;
        })
        .then((data) => {
            for (let i=0; i<data.length; i++) {
                if (data[i].id === id) {
                    setLocation(data[i])
                }
            }
        })
    });

    console.log(useEffect);
    return (
        <div>
        </div>
    );
}
